import React, { Component } from 'react';
import './App.css';
import Footer from './components/Footer';


const App = () => {
  return (
    <div>
      <nav>
        <h1>Hello</h1>
        <ul>
          <li>1</li>
          <li>2</li>
          <li>3</li>
        </ul>
      </nav>
      <main>
        <p>Put the contents here</p>
      </main>
      <Footer/>
    </div>
  );
}
export default App;
